import React from 'react';
import Trigger from '../components/Trigger';
import imgShild from '../assets/images/Main-images/shild.png'
import imgBag from '../assets/images/Main-images/bag.png'
import imgTime from '../assets/images/Main-images/time.png'


const Main = () => {
    return (
        <div>
            <div className="_container-1">
                <div className="triggers">
                    <Trigger imgPath={imgShild} title = 'защита' />
                    <Trigger imgPath={imgBag} title = 'твоё Будущее' />
                    <Trigger imgPath={imgTime} title = 'Бизнес предложения' />
                </div>
            </div>
        </div>
    );
};

export default Main;
